import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="navbar">
        <img/>
      <Link to="/">Home</Link>
      <Link to="/">Order</Link>
      <Link to="/">Leaderboards</Link>
      <Link to="/">Marketplace</Link>
      <Link to="/faqs">FAQs</Link>
    </div>
  );
};
export default NavBar;
